import React, { useState } from "react";

export default function FacultyPanel({ teachers, addTeacher, deleteTeacher }) {
  const [teacherName, setTeacherName] = useState("");
  const [teacherAge, setTeacherAge] = useState("");
  const [teacherQualification, setTeacherQualification] = useState("");
  const [teacherCnic, setTeacherCnic] = useState("");
  const [teacherContact, setTeacherContact] = useState("");
  const [teacherAddress, setTeacherAddress] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    if (
      !teacherName ||
      !teacherAge ||
      !teacherQualification ||
      !teacherCnic ||
      !teacherContact ||
      !teacherAddress
    ) {
      return alert("Please fill all teacher fields");
    }

    addTeacher({
      name: teacherName,
      age: teacherAge,
      qualification: teacherQualification,
      cnic: teacherCnic,
      contact: teacherContact,
      address: teacherAddress,
    });

    setTeacherName("");
    setTeacherAge("");
    setTeacherQualification("");
    setTeacherCnic("");
    setTeacherContact("");
    setTeacherAddress("");
  };

  return (
    <div className="panel">
      <h2>üë©‚Äçüè´ Teacher Panel</h2>

      <form onSubmit={handleSubmit}>
        <div className="panel-form-row">
          <div className="field">
            <input
              className="input"
              type="text"
              placeholder="Name"
              value={teacherName}
              onChange={(e) => setTeacherName(e.target.value)}
            />
          </div>

          <div className="field xsmall">
            <input
              className="input"
              type="number"
              placeholder="Age"
              value={teacherAge}
              onChange={(e) => setTeacherAge(e.target.value)}
            />
          </div>

          <div className="field">
            <input
              className="input"
              type="text"
              placeholder="Qualification"
              value={teacherQualification}
              onChange={(e) => setTeacherQualification(e.target.value)}
            />
          </div>

          <div className="field">
            <input
              className="input"
              type="text"
              placeholder="CNIC (e.g. 12345-6789012-3)"
              value={teacherCnic}
              onChange={(e) => setTeacherCnic(e.target.value)}
            />
          </div>

          <div className="field narrow">
            <input
              className="input"
              type="text"
              placeholder="Contact No"
              value={teacherContact}
              onChange={(e) => setTeacherContact(e.target.value)}
            />
          </div>

          <div style={{ display: "flex", alignItems: "center" }}>
            <button className="create-button" type="submit">
              Add
            </button>
          </div>
        </div>

        {/* Secondary row for address or larger multi-line inputs */}
        <div className="panel-form-row">
          <div className="field" style={{ flex: 2 }}>
            <input
              className="input"
              type="text"
              placeholder="Home Address"
              value={teacherAddress}
              onChange={(e) => setTeacherAddress(e.target.value)}
            />
          </div>
        </div>
      </form>

      <ul className="list">
        {teachers.map((t) => (
          <li key={t.id} className="list-item">
            <div>
              <strong>{t.name}</strong> ({t.age} yrs) <br />
              CNIC: {t.cnic} <br />
              Qualification: {t.qualification} <br />
              Contact: {t.contact} <br />
              Address: {t.address}
            </div>

            <button className="delete-button" onClick={() => deleteTeacher(t.id)}>
              ‚ùå
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}
